--
-- Disparadores `orden_compra`
--
DELIMITER $$
CREATE TRIGGER `actualizar_fecha_cobro` BEFORE UPDATE ON `orden_compra` FOR EACH ROW BEGIN
    IF NEW.estado = 'comprado' AND OLD.estado <> 'comprado' THEN
        SET NEW.fecha_cobro = CURRENT_TIMESTAMP;
    END IF;
END
$$
DELIMITER ;
DELIMITER $$
CREATE TRIGGER `actualizar_num_inscritos` AFTER UPDATE ON `orden_compra` FOR EACH ROW BEGIN
  IF NEW.estado = 'comprado' AND OLD.estado <> 'comprado' THEN
    UPDATE cursos
    SET num_inscritos = num_inscritos + 1
    WHERE id = NEW.id_curso;
  END IF;
END
$$
DELIMITER ;
DELIMITER $$
CREATE TRIGGER `before_cancelacion_compra` BEFORE DELETE ON `orden_compra` FOR EACH ROW BEGIN
  -- Guardar los datos de la fila eliminada
  INSERT INTO orden_eliminada (id, id_curso, num_usuarios_d)
  VALUES (OLD.id, OLD.id_curso, OLD.num_usuarios_d);
END
$$
DELIMITER ;
DELIMITER $$
CREATE TRIGGER `before_confirmacion_compra` BEFORE UPDATE ON `orden_compra` FOR EACH ROW BEGIN
  -- Actualizar el número de usuarios confirmados
  IF OLD.estado = 'sin_confirmar' AND NEW.estado = 'en_cola' THEN
    SET NEW.num_usuarios_c = OLD.num_usuarios_c + 1;
    SET NEW.precio_dividido = NEW.precio_curso / NEW.num_usuarios_c;
  END IF;

  -- Cambiar a 'comprado' si num_usuarios_d es igual a num_usuarios_c
  IF NEW.num_usuarios_d = NEW.num_usuarios_c THEN
    SET NEW.estado = 'comprado';
  END IF;
END
$$
DELIMITER ;

