--
-- Disparadores `user_rating`
--
DELIMITER $$
CREATE TRIGGER `actualizar_rating_curso` AFTER INSERT ON `user_rating` FOR EACH ROW BEGIN
  DECLARE nuevo_sum INT;
  DECLARE nuevo_count INT;

  SELECT sum_rating + NEW.rating, num_rating + 1
  INTO nuevo_sum, nuevo_count
  FROM cursos
  WHERE id = NEW.idCurso;

  UPDATE cursos
  SET 
    sum_rating = nuevo_sum,
    num_rating = nuevo_count,
    rating = nuevo_sum / nuevo_count
  WHERE id = NEW.idCurso;
END
$$
DELIMITER ;

