DELIMITER $$
--
-- Eventos
--
CREATE DEFINER=`root`@`localhost` EVENT `actualizar_orden_compra` ON SCHEDULE EVERY 1 SECOND STARTS '2025-02-08 19:00:44' ON COMPLETION NOT PRESERVE ENABLE DO BEGIN
  -- Asegurar que todas las filas tengan el mismo número de usuarios confirmados
  UPDATE `orden_compra` oc1
  JOIN (SELECT id, id_curso, MAX(num_usuarios_c) AS max_usuarios_c FROM `orden_compra` GROUP BY id, id_curso) oc2
  ON oc1.id = oc2.id AND oc1.id_curso = oc2.id_curso
  SET oc1.num_usuarios_c = oc2.max_usuarios_c,
      oc1.precio_dividido = oc1.precio_curso / oc2.max_usuarios_c;

  -- Marcar todas las filas como 'comprado' si num_usuarios_c = num_usuarios_d
  UPDATE `orden_compra`
  SET estado = 'comprado'
  WHERE num_usuarios_c = num_usuarios_d;
END$$

CREATE DEFINER=`root`@`localhost` EVENT `actualizar_orden_despues_borrado` ON SCHEDULE EVERY 1 SECOND STARTS '2025-02-08 19:08:02' ON COMPLETION NOT PRESERVE ENABLE DO BEGIN
  -- Actualizar el número de usuarios divididos después de una eliminación
  UPDATE `orden_compra` oc
  JOIN `orden_eliminada` oe ON oc.id = oe.id AND oc.id_curso = oe.id_curso
  SET oc.num_usuarios_d = oc.num_usuarios_d - 1
  WHERE oc.num_usuarios_d > 1;

  -- Eliminar registros procesados de la tabla temporal
  DELETE FROM orden_eliminada;
END$$

CREATE DEFINER=`root`@`localhost` EVENT `actualizar_estadisticas_generales` ON SCHEDULE EVERY 1 MINUTE STARTS '2025-05-01 11:43:35' ON COMPLETION NOT PRESERVE ENABLE DO BEGIN
  UPDATE estadisticas_generales
  SET
    cursos_totales = (SELECT COUNT(*) FROM cursos),
    usuarios_registrados = (SELECT COUNT(*) FROM usuarios),
    valoracion_promedio = (
      SELECT 
        IFNULL(ROUND(SUM(sum_rating) / NULLIF(SUM(num_rating), 0), 1), 0)
      FROM cursos
      WHERE rating != -1.0
    ),
    certificados_emitidos = (SELECT COUNT(*) FROM certificados);
END$$

DELIMITER ;
